// src/App.js
import React from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import StudentList from './components/Student/StudentList';
import CourseList from './components/Course/CourseList';
import FacultyList from './components/Faculty/FacultyList';
import { useDispatch } from 'react-redux';
import { setStudents, setCourses, setFaculty } from './redux/actions';


const App = () => {

const dispatch = useDispatch();

useEffect(() => {
  // Fetch or mock data
  dispatch(setStudents(mockStudents));
  dispatch(setCourses(mockCourses));
  dispatch(setFaculty(mockFaculty));
}, [dispatch]);
  return (
    <Router>
      <Routes>
        <Route path="/students" element={<StudentList />} />
        <Route path="/courses" element={<CourseList />} />
        <Route path="/faculty" element={<FacultyList />} />
        <Route path="/" element={<h1>Welcome to College Management System</h1>} />
      </Routes>
    </Router>
  );
};

export default App;
